from datetime import datetime
import numpy as np


class NumMatrix:

    def __init__(self, matrix):
        self.matrix = np.array(matrix)
        self.s = np.zeros((202,202), dtype=np.int64)
        self.filled = np.zeros((202,202), dtype=np.bool_)
    def sumRegion(self, row1: int, col1: int, row2: int, col2: int) -> int:
        # Your NumMatrix object will be instantiated and called as such:
        # obj = NumMatrix(matrix)
        # param_1 = obj.sumRegion(row1,col1,row2,col2)
        def presum(i,j):
            if self.filled[i,j]: return self.s[i,j]
            self.s[i,j] = np.sum(self.matrix[:i+1,:j+1])
            self.filled[i,j] = True
            return self.s[i,j]
        p1 = presum(row2, col2)
        p2 = presum(row2, col1-1)
        p3 = presum(row1-1, col2)
        p4 = presum(row1-1, col1-1)
        result =  p1 - p2 - p3 + p4
        return result



